import { createAction } from '@reduxjs/toolkit';
import { initialDataState } from '../type/Type';

// types
const GET_STATE = 'data/GET_STATE';

// actions
export const getState = createAction<{
    state: any;
}>(GET_STATE)

const dataReducer = (
    state = initialDataState,
    action: {
        type: string;
        payload?: any;
    }
) => {
    switch (action.type) {
        case GET_STATE:
            return {
                ...state,
                ...action.payload
            }
        default:
            return state;
    }
}

export default dataReducer;
